import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Navigation from './Navigation';

const Profile = ({ handleLogout }) => {
    const [profile, setProfile] = useState({
        name: '',
        email: '',
        username: '',
        profilePicture: ''
    });
    const [currentPassword, setCurrentPassword] = useState('');
    const [newPassword, setNewPassword] = useState('');
    const [message, setMessage] = useState('');

    useEffect(() => {
        const fetchProfileDetails = async () => {
            try {
                const token = localStorage.getItem('token');
                const res = await axios.get('http://localhost:5000/api/auth/profile', {
                    headers: { 'Authorization': `Bearer ${token}` }
                });
                setProfile(res.data);
            } catch (err) {
                console.error(err);
            }
        };
        fetchProfileDetails();
    }, []);

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setProfile({ ...profile, [name]: value });
    };

    const handleProfileUpdate = async (e) => {
        e.preventDefault();
        try {
            const token = localStorage.getItem('token');
            const res = await axios.post('http://localhost:5000/api/auth/profile/update', profile, {
                headers: { 'Authorization': `Bearer ${token}` }
            });
            setProfile(res.data);
            setMessage('Profile updated successfully');
        } catch (err) {
            console.error(err);
            setMessage('Error updating profile');
        }
    };

    const handleChangePassword = async (e) => {
        e.preventDefault();
        try {
            const token = localStorage.getItem('token');
            await axios.post('http://localhost:5000/api/auth/user/change-password', {
                currentPassword,
                newPassword
            }, {
                headers: { 'Authorization': `Bearer ${token}` }
            });
            setMessage('Password updated successfully');
            setCurrentPassword('');
            setNewPassword('');
        } catch (err) {
            console.error(err);
            setMessage('Error changing password');
        }
    };

    return (
        <div className="container">
            <Navigation handleLogout={handleLogout} />
            <div className="form">
                <h2>Profile</h2>
                <form onSubmit={handleProfileUpdate}>
                    <div>
                        <label>Name</label>
                        <input type="text" name="name" value={profile.name} onChange={handleInputChange} />
                    </div>
                    <div>
                        <label>Email</label>
                        <input type="email" name="email" value={profile.email} onChange={handleInputChange} />
                    </div>
                    <div>
                        <label>Username</label>
                        <input type="text" name="username" value={profile.username} onChange={handleInputChange} />
                    </div>
                    <div>
                        <label>Profile Picture URL</label>
                        <input type="text" name="profilePicture" value={profile.profilePicture} onChange={handleInputChange} />
                    </div>
                    <button type="submit">Update Profile</button>
                </form>
                <form onSubmit={handleChangePassword}>
                    <h3>Change Password</h3>
                    <div>
                        <label>Current Password</label>
                        <input type="password" value={currentPassword} onChange={(e) => setCurrentPassword(e.target.value)} />
                    </div>
                    <div>
                        <label>New Password</label>
                        <input type="password" value={newPassword} onChange={(e) => setNewPassword(e.target.value)} />
                    </div>
                    <button type="submit">Change Password</button>
                </form>
                {message && <p>{message}</p>}
            </div>
        </div>
    );
};

export default Profile;
